sys_variable_value.value:
(function execute(inputs, outputs) {

  var req=inputs.requestbody;
  var funds=req.product.funds;
  funds.forEach(function(element){
    if (element.name=="" && element.value==""){
      throw new Error(); 
    }
})
// ... code ...
})(inputs, outputs);

